import React, { useState, useEffect } from 'react';

const LawSearch = ({ query, filter }) => {
  const [laws, setLaws] = useState([]);

  useEffect(() => {
    fetch(`/api/laws?query=${query}&filter=${filter}`)
      .then(response => response.json())
      .then(data => setLaws(data))
      .catch(error => console.error('Error fetching laws:', error));
  }, [query, filter]);

  return (
    <div>
      <h2>Search Results:</h2>
      {laws.length > 0 ? (
        <ul>
          {laws.map(law => (
            <li key={law.id}>
              <h3>{law.title}</h3>
              <p>{law.description}</p>
              <p>Category: {law.category}</p>
              <p>Citation: {law.citation}</p>
              <a href={law.url} target="_blank" rel="noopener noreferrer">
                Read the full law
              </a>
            </li>
          ))}
        </ul>
      ) : (
        <p>No laws found for your search.</p>
      )}
    </div>
  );
};

export default LawSearch;
